import { createSlice } from '@reduxjs/toolkit'

const initialState = {
    stringData: String
}

const updateStringData = createSlice({
  name: 'stringData',
  initialState,
  reducers: {
    updateStringData: (state, action) => {
      state.stringData = action.payload
    }
  }
})

export const { query } = stringSlice.actions

export default stringSlice.reducer
